import React, { Component } from "react";

export default class Login extends Component {
	render() {
		return (
			<div className="login">
				<div class="container">
					<div class="row align-items-center my-5">
						<div class="col-lg-5 mx-auto">
							<h1>Login</h1>
						</div>
					</div>
				</div>
			</div>
		);
	}
}
